import React , {useState,useEffect} from "react";
import "./index.css";
const A = () =>{
    return (
    <>
    <select>
        <option value='1'>1</option>
        <option value='25'>25</option>
        <option value='3'>3</option>
        <option value='4'>4</option>
        <option value='6'>6</option>
    </select>
    </>);
};
export default A;
